	allReducers,
	window.__REDUX_DEVTOOLS_EXTENSTION__ && window.__REDUX_DEVTOOLS_EXTENSION__()
);



ReactDOM.render(
	<React.StrictMode>
		<DashboardContextProvider>
			<FilterContextProvider>
				<App />
			</ FilterContextProvider>
		</ DashboardContextProvider>
	</ React.StrictMode>,
  document.getElementById('root')
);
